function M.dashboard()
  math.randomseed(os.time())
  local logo = headers[math.random(#headers)]

  -- Add padding to the top and bottom of the logo
  logo = string.rep('\n', 2) .. logo .. '\n'
  logo = logo .. '  ' .. '[ @EricSiwakoti ]' .. '\n\n'

  return logo
end

